import { useState, useEffect } from 'react'
import { useParams } from 'react-router-dom'
import { useController } from '../Controller'

export function MoviePage() {
  const { getMovie } = useController()
  const params = useParams()
  const id = params.id

  useEffect(() => {
    getMovie(id)
  }, [])

  return <div></div>
}
